const backUpLiveBlance = async function(){
    const sql = `CREATE TABLE tron_live.back_live_balance (
        uid bigint(20) DEFAULT NULL,
        currency varchar(32) DEFAULT NULL,
        addr varchar(128) DEFAULT NULL,
        tag varchar(128) DEFAULT NULL,
        balance bigint(20) unsigned DEFAULT '0',
        UNIQUE KEY back_uid_addr_tag (uid,currency,tag),
        UNIQUE KEY back_currency_addr_tag (currency,addr,tag),
        KEY back_live_balance_uid_currency (uid,currency)
) ENGINE=InnoDB DEFAULT CHARSET=utf8
`
    await raw(sql,[])
}


